import React from 'react'
import './EvJobs.css'

const EvJobs = () => {
  return (
    <>
      <h1 style={{ fontSize: "50px", fontWeight: "700", color: "#4dbf1c", textAlign: "center", paddingBottom: '50px', paddingTop: '35px' }}>EV Jobs</h1>

    </>
  )
}

export default EvJobs
